import React, { useState } from "react";
import Button from "../Button";

function Header() {
  const [Manu, setManu] = useState(true)
  const [Search, setSearch] = useState(true)
  const [ChangeData, setChangeData] = useState({
    manu: {
      button: "fas fa-bars",
      class: "",
    },
    search: {
      button: "fas fa-search",
      class: "",
    },
  });

  const clickedManu = () => {
    setManu(!Manu)
    console.log(Manu);
    if(Manu) {
      setChangeData({
        ...ChangeData,
        manu : {
          ...ChangeData.manu,
          button : ''
        }
      })
    }
  }
  return (
    <div id="header-block">
      <div className="container">
        <span id="header-logo">
          <h1>Switch</h1>
        </span>
        <div id="header-flexbox" className="flex">
          <nav id="header-manu">
            <i class={ChangeData.manu.button} onClick={clickedManu}></i>
            <ul className="flex">
              <li>
                <div></div>
                <a href="#home-container">home</a>
              </li>
              <li>
                <div></div>
                <a href="#what-we-do">what we do?</a>
              </li>
              <li>
                <div></div>
                <a href="#testimonials">testimonial</a>
              </li>
              <li>
                <div></div>
                <a href="#footer-container">contact us</a>
              </li>
            </ul>
          </nav>
          <div id="header-input-wrapper">
            <buttom id="header-input button">
              <i class={ChangeData.search.button}></i>
            </buttom>
            <div id="header-input">
              <input id="input" type="text" placeholder="Search" />
              <button>
                <i class="fas fa-search"></i>
              </button>
            </div>
          </div>
        </div>
      </div>
      <div id="home-container">
        <div id="home-content-center">
          <div id="home-content-flex" className="flex">
            <h1>Art is Eternal Happiness</h1>
            <Button name="work with us" />
          </div>
        </div>
        <div id="home-down-button">
          <button className="btn">Scroll Down</button>
        </div>
      </div>
    </div>
  );
}

export default Header;
